import { useNavigate } from "react-router-dom";
import { useState } from "react";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import { userActions } from "../store/user-slice";

import "./PirateSignup.css";

const PirateSignup = (props) => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const users = props.users;
  const [userId, setUserId] = useState("");
  const [password, setPassword] = useState("");

  const handleClick = () => {
    // users.push({ userId, password });
    dispatch(userActions.setUser({ userId, password }));
    navigate("/pirate");
  };
  return (
    <div id="pirateHome">
      <div id="pirateDiv">
        Enter Email : <input type="email" />
        <br />
        Enter userId :{" "}
        <input
          type="text"
          onChange={(event) => setUserId(event.target.value)}
        />
        <br />
        New Password : <input type="password" />
        <br />
        Confirm Password :{" "}
        <input
          type="password"
          onChange={(event) => setPassword(event.target.value)}
        />
        <br />
        <button className="piratebtn success" onClick={handleClick}>
          SignUp
        </button>
      </div>
    </div>
  );
};

export default PirateSignup;
